(function () {
    'use strict';

    angular.module('app')
        .service('redirectService', redirectService);

    function redirectService() {
        var service = this;

        service.home = function (shouldRedirect) {
            var url = '/';

            if (!shouldRedirect)
                return url;

            return redirect(url);
        }

        service.admin = function (shouldRedirect) {
            var url = '/admin';

            if (!shouldRedirect)
                return url;

            return redirect(url);
        }

        service.createPost = function (shouldRedirect) {
            var url = '/admin/post/createpost';

            if (!shouldRedirect)
                return url;

            return redirect(url);
        }

        service.editPost = function (id, shouldRedirect) {
            var url = '/admin/post/editpost/' + id;

            if (!shouldRedirect)
                return url;

            return redirect(url);
        }

        service.manageAccount = function (shouldRedirect) {
            var url = '/admin/account/manage';

            if (!shouldRedirect)
                return url;

            return redirect(url);
        }

        service.displayPost = function (urlParameter, shouldRedirect) {
            var url = '/post/' + urlParameter;

            if (!shouldRedirect)
                return url;

            return redirect(url);
        }

        service.displayPostOnCategory = function (urlParameter, shouldRedirect) {
            var url = '/post/category/' + urlParameter.toLowerCase();

            if (!shouldRedirect)
                return url;

            return redirect(url);
        }

        function redirect(url) {
            window.location.href = url;
        }

        return service;
    }
})();
(function () {
    'use strict';

    angular.module('app')
        .service('urlService', urlService);

    function urlService() {
        var service = this;
        
        service.getLastUrlParameter = function() {
            return window.location.href.substr(window.location.href.lastIndexOf('/') + 1);
        }

        return service;
    }
})();
(function () {
    'use strict';

    angular.module('app')
        .service('sideMenuService', sideMenuService);

    function sideMenuService(categoryService, ngDialog) {
        var service = this;

        service.categories = [];

        init();
        function init() {
            getAllCategories();
        }

        service.createCategory = function () {
            var categoryName = window.prompt('Insert category name', '');

            if ($.trim(categoryName) === '')
                return;

            var category = { title: categoryName };

            categoryService.createCategory(category).then(function (response) {
                insertSideMenuCategory(response.data);
            }, function(response) {
                alert(response.data);
            });
        }

        service.uploadImage = function () {
            ngDialog.open(
                {
                    template: '/templates/upload-image.template.html',
                    className: 'ngdialog-theme-default',
                    controller: 'UploadImageController as vm'
                });
        }

        service.editCategory = function(category) {
            var categoryName = window.prompt('Insert category name', '');

            if ($.trim(categoryName) === '')
                return;

            categoryService.editCategory({title: categoryName, id: category.id}).then(function() {
                category.title = categoryName;
            }, function(response) {
                alert(response.data);
            });
        }

        service.deleteCategory = function(category) {          
            categoryService.deleteCategory(category.id).then(function () {
                service.categories = service.categories.filter(item => item !== category);
            });
        }

        function getAllCategories() {
            categoryService.getAllCategories().then(function (response) {
                setupSideMenuCategory(response.data);
            });
        }

        function setupSideMenuCategory(categories) {
            angular.forEach(categories, function (category) {
                insertSideMenuCategory(category);
            });
        }

        function insertSideMenuCategory(category) {
            service.categories.push({
                title: category.title,
                id: category.id,
                selected: false
            });
        }
    }
})();
